import foot from './foot.png';
import olympic from './olympic.png';
import { useState } from "react";

const [image, setImage] = useState(foot);
const Change = () => {
    if(image===foot) {
        setImage(olympic);
    } else {
        setImage(foot);
    }
    return (
        <p><img src={image} height="900" width="1200" alt=""/></p>
    );
};
const Bodies = () => {
    setTimeout(Change, 5000);
};

export default Bodies;
